import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'; // A침ade esta importaci칩n
import { faPhone } from '@fortawesome/free-solid-svg-icons';
import './NavBar.css';
import logo from './img/logoDentalViscaya.png'; 

function NavBar() {
  return (
    <nav className="navbar">
      <div className="logo">
        <img src={logo} alt="Logo" />
      </div>
      <ul className="nav-links">
        <li><a href="#inicio">Inicio</a></li>
        <li><a href="#nosotros">Nosotros</a></li>
        <li><a href="#servicios">Servicios</a></li>
        <li><a href="#contacto">Contacto</a></li>
      </ul>
      <div className="phone-btn">
        <button className="phone-button" onClick={() => window.location.href = 'tel:+123456789'}>
          <FontAwesomeIcon icon={faPhone} />
          123456789
        </button>
      </div>
    </nav>
  );
}

export default NavBar;
//En las lineas 19-24 modifiicar el numero de teled
